        }
        version = "0";
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function withdraw() public {
        if (msg.sender == fundswallet) {
            fundswallet.transfer(this.balance);
        }
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        if (balanceOf[_from] >= _value && allowance[_from][msg.sender] >= _value && balanceOf[_to] + _value >= balanceOf[_to]) {
            balanceOf[_from] -= _value;
            balanceOf[_to] += _value;
            allowance[_from][msg.sender] -= _value;
            return true;
        }
        return false;
    }

    function setTokenPrice(uint256 _value) public returns (bool success) {
        if (_value < 1500 && msg.sender == fundswallet) {
            unitsoneethcanbuy = _value;
            return true;
        }
        return false;
    }

    function burn(uint256 _value) public returns (bool success) {
        if (balanceOf[msg.sender] >= _value) {
            balanceOf[msg.sender] -= _value;
            totalSupply2 -= _value;
            return true;
        }
        return false;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        if (balanceOf[msg.sender] >= _value && balanceOf[_to] + _value >= balanceOf[_to]) {
            balanceOf[msg.sender] -= _value;
            balanceOf[_to] += _value;
            return true;
        }
        return false;
    }

    function stopIco() public returns (bool success) {
        if (now >= fundingendtime) {
            createtokensforcrypton = true;
            return true;
        }
        return false;
    }

    function burnFrom(address _from, uint256 _value) public returns (bool success) {
        if (balanceOf[_from] >= _value && allowance[_from][msg.sender] >= _value) {
            balanceOf[_from] -= _value;
            allowance[_from][msg.sender] -= _value;
            totalSupply2 -= _value;
            return true;
        }
        return false;
    }

